import React from "react";
import {
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  withStyles
} from "@material-ui/core";

const styles = theme => ({
  formControl: {
    margin: theme.spacing.unit,
    minWidth: 120
  }
});

export default withStyles(styles)(
  ({ classes, values, handleChange, selection }) => {
    return (
      <FormControl className={classes.formControl}>
        <InputLabel>Type</InputLabel>
        <Select
          native
          value={selection}
          onChange={handleChange("discTypeSelector")}
          inputProps={{
            name: "type",
            id: "type-native-simple"
          }}
        >
          <MenuItem value="">
            <em>None</em>
          </MenuItem>
          {values.map(value => (
            <MenuItem value={value}>{value}</MenuItem>
          ))}
        </Select>
      </FormControl>
    );
  }
);
